import { ADD_EXPENSE, delete_expense } from "../action-types/expenses";
export const addExpense = (data) => {
  return {
    type: ADD_EXPENSE,
    data: data,
  };
};
export const deleteExpense = (id) => {
  return {
    type: delete_expense,
    data,
  };
};
